  false,\n\t\"url\": null,\n\t\"notes\": \"This document outlines a plan of action
  for nongame bird conservation in the Northcentral United States, including the States
  of Illinois, Indiana, Iowa, Michigan, Minnesota, Missouri, Ohio, and Wisconsin.
  This area corresponds to Region 3 of the U. S. Fish and Wildlife Service. The plan
  addresses actions that are needed to maintain and enhance nongame bird populations
  and habitats in the Upper Midwest, both on and off Service lands. While the tasks
  set forth in this document primarily focus on efforts that the Region will undertake
  or coordinate, cooperative ventures with other agencies and organizations will be
  necessary to fully achieve the plan's objectives. This plan is intended to be a
  dynamic document that will be revised as necessary to reflect changing priorities
  and to address new issues.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
